import React from 'react';



export default class ItemCarrossel extends React.Component {
    render() {
        let myJson = [
            {
                label: 'Projeto Captura Ovo',
                imagesrc: '',
                caption: 'Software para detecção de ovos do mosquito da Dengue.'
            },
            {
                label: 'tooFast',
                imagesrc: '',
                caption: 'Front-end para gerenciamento de e-mails.'
            },
            {
                label: 'Este Site',
                imagesrc: '',
                caption: 'Meu portfólio online.'
            }
        ];
        let width = 400;
        let height = 400;

        return (
            <>
                <Carousel.Item>
                    <div>a</div>

                    <img width={900} height={500} alt="900x500" src="/carousel.png" />
                    <Carousel.Caption>
                        <h3>First slide label</h3>
                        <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
                    </Carousel.Caption>
                </Carousel.Item>
                <Carousel.Item>
                    <img width={900} height={500} alt="900x500" src="/carousel.png" />
                    <Carousel.Caption>
                        <h3>Second slide label</h3>
                        <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
                    </Carousel.Caption>
                </Carousel.Item>
                <Carousel.Item>
                    <img width={900} height={500} alt="900x500" src="/carousel.png" />
                    <Carousel.Caption>
                        <h3>Third slide label</h3>
                        <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
                    </Carousel.Caption>
                </Carousel.Item>
            </>
        );

    }
}
